import React, { Component } from "react";
import TextField from "@material-ui/core/TextField";

class SignUp2 extends Component {
  state = {};
  render() {
    return (
      <div>
        <TextField
          id="outlined-name"
          label="Name"
          margin="normal"
          variant="outlined"
        />
      </div>
    );
  }
}
export default SignUp2;
